import React from 'react';
import './App.css';
import Navigation from './Component/Navigation/Navigation';
import Logo from './Component/Logo/Logo';
import ImageLinkFrom from './Component/ImageLinkFrom/ImageLinkFrom';
import Rank from './Component/Rank/Rank';
import clarifai from 'clarifai';

const app=new clarifai.App({apiKey:'dbd83ed35798494a8c291658985c8e4b'});



class App extends React.Component{
  constructor(){
    super();
    this.state={
      input:'',
    }
  }

  oninputchange=(event)=>{
    console.log(event.target.value);
  }

  onbuttonsubmit=()=>{
    console.log("click");
    app.models.predict("dbd83ed35798494a8c291658985c8e4b",'.')
    .then(
      function(response){
        console.log(response);
      }, 
      function( reject){
        console.log(reject);
      }




    );
  }

  render() {
  return (
    <div className="App">

      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkFrom  oninputchange={this.oninputchange} onbuttonsubmit={this.onbuttonsubmit} />
    </div>
  );
}
}

export default App;
